import { Link } from "react-router-dom"

function Footer() {
    return(
        <>
    <div className=" text-center py-3"> © 2024 Copyright: MedHub
    <br></br>
        
      
        <Link to="https://github.com/Yves-Shaheem/applicationWeb.git"><i class="fa-brands fa-github"></i></Link>
    
        
    </div>
    </>
);
}

export default Footer;
